import styled from "styled-components";

export const Wrapper = styled.div`
    background: 

      url(${({ image }) => image}), var(--darkGrey);
    /* background-size: 100%, cover;
    height: 600px;
    position: relative; */

    display: block;

`;

export const Context = styled.div`
    padding-top: 40px;
    padding-bottom: 95px;

    .deoberPosition{
        padding: 2px;
        margin: auto;
        margin-top: 40%;

        .logoDeobers{
            width: 114%;
            font-size: 29px;
            margin: auto;
            display: flex;
            text-align: center;
        }
    }
`;

export const Image = styled.img`
`;
